import React from 'react';
import {Link, BrowserRouter} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <nav className="nav-wrapper grey">
          <div className="container">
            <Link to="/" className="brand-logo">
              <img src="C:/Users/nsriv/Desktop/bitmoji.jpg"></img>
            </Link>
          </div>
        </nav>
      </div>
    </BrowserRouter>
  );
}

export default App;
